import React from 'react'
import "./Profile.css"
import { useSelector } from 'react-redux'

import user from '../../Assets/user.png'

function Profile() {

    const {userData} = useSelector((state)=> state.userSlice)

    return (
        <div className='Profile'>
            <img src={user}></img>
            <></>
        </div>
    )
}

export default Profile
